import api from "../../../api";

export default function DoctorsList({ onHistoryClick }) {
    const [doctors, setDoctors] = useState([]);

    useEffect(() => {
      api.get("/admin/get-doctors").then((res) => setDoctors(res.data.data));
    }, []);

    return (
      <div>
        <h3>Doctors</h3>
        {doctors.map((doc) => (
